import React, { useState } from "react";
import { Route, Routes } from "react-router-dom";

const Home = () => {
    return (
        <div>
            <Routes>
                <Route path="/" element={isLoggedIn ? <Home /> : <Navigate to="/login" />}/>
                <Route path="/login" element={<Login setIsLoggedIn={setIsLoggedIn} />} />
            </Routes>
        </div>
    )
}

export default Home;
